        if x == 0 and y == 0 and len(visited[x][y]) == k:
            return True
        visited[x][y] = False
        return False

    def dfs_helper(x, y):
        if x == 0 and y == 0:
            return []
        if x == 0:
            return dfs_helper(y + 1, 0)
        if y == 0:
            return dfs_helper(x - 1, 0)
        if grid[x - 1][y] == grid[x][y - 1] == grid[x + 1][y - 1] == grid[x + 1][y]:
            return dfs_helper(x - 1, y - 1) + [grid[x][y]] + dfs_helper(x + 1, y - 1)
        return dfs_helper(x - 1, y) + dfs_helper(x + 1, y)

